import * as React from 'react'
import { NextPage } from 'next'

const css = require('./index.module.css')

const Admin: NextPage = (): JSX.Element => {

    return (
        <div className={css.Main}>
            <p>this is the admin page</p>
        </div>
    )
}

export default Admin
